import React, { Component } from "react";
import Slider from "react-slick";
import '../app.css';

export default class AutoPlay extends Component {
  render() {
    const settings = {
      infinite: true,
      slidesToShow: 3,
      slidesToScroll: 1,
      autoplay: true,
      speed: 3000,
      autoplaySpeed: 3000,
      cssEase: "linear"
    };
    return (
    <div className="content">
      <div className="container">
        <h1 style={{fontSize: 50, color: "white"}}>Selamat Datang Di Website Travelku.id</h1>
        <Slider {...settings}>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center", color: "white"}}>1</h1>
          </div>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center"}}>2</h1>
          </div>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center"}}>3</h1>
          </div>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center"}}>4</h1>
          </div>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center"}}>5</h1>
          </div>
          <div>
            <h1 style={{fontSize: 100, textAlign: "center"}}>6</h1>
          </div>
        </Slider>
        </div>
      </div>
    );
  }
}
